				<div className="container">
					<h2>Congratulations, you have chosen {this.props.value}</h2>
				</div>

				<style jsx>
					{`
						.card-space {
							// margin-top: 50px;
							padding-top: 5%;
							padding-bottom: 5%;
							// text-align: center;
							// display: inline-block;
						}

						.eachListing {
							// border: 1px solid blue;
							margin-bottom: 10px;
							padding: 15px;
							// width: 1000px;
							// margin: 0 auto;
							box-shadow: 9px 9px 9px rgb(240, 240, 240);
						}

						li {
							list-style: none;
						}

						.verticalAlign {
							// padding: 2% 0;
						}

						.vertical {
							padding: 4% 0;
						}
					`}
				</style>
			</div>
		);
	}
}
